package com.ifnc.service;

public class CalculadoraFuncoes implements Calculadora{

	@Override
	public float soma(float a, float b) {
		// TODO Auto-generated method stub
		return a+b;
	}

	@Override
	public float subtrair(float a, float b) {
		// TODO Auto-generated method stub
		return a-b;
	}

	
}
